    for (let v = 0; v < ar1.length; v++) {
      if (props.infoprecent[ar1[v]].length !== 0) {
        if (
          event.target.id.toLowerCase() === Object.keys(props.infoprecent)[v]
        ) {
          event.target.value = (
            (props.old[v] * props.infoprecent[ar1[v]]) /
            100
          ).toFixed(2);
          props.SetInfoPrecent({ ...props.infoprecent, v: event.target.value });
        }
      }
    }
  }

  function changeInputValueFromNumber(event) {
    for (let v = 0; v < ar1.length; v++) {
      if (props.info[ar1[v]].length !== 0) {
        if (event.target.id.toLowerCase() === Object.keys(props.info)[v]) {
          event.target.value = (
            (props.info[ar1[v]] / props.old[v]) *
            100
